import epiloveers from './epilovers.png'

class Bottom extends React.Component {
    render(){
        return (
            <div className="bottomContainer"> 
                <div className ="firstbottomContainer">
                    <a href ="#">INFORMATIONS</a>
                    <a href ="#">LE PROJET</a>
                    <a href ="#">GALLERIE</a>
                </div>

                <div className="mediaBottomContainer"> 
                    <button type="button" className="btn btn-secondary btn-circle btn-sm"></button>
                    <button type="button" className="btn btn-secondary btn-circle btn-sm"></button>
                    <button type="button" className="btn btn-secondary btn-circle btn-sm"></button>
                </div>

                <img src ={epiloveers} alt ="logo" width ="15%" margin ="auto"></img>

                <div>© 2020 Ankama. Tous droits réservés. Hack'n Love et Epilovers ne peuvent en aucun cas etre uti</div> 
            </div>
        )
    }
}

export default Bottom;
